    spacing_below: small, background: ''}
  name: column_panel_1
  layout_properties: {grid_position: 'VYKJZK,KXGFFY'}
  components:
  - type: Label
    properties: {role: null, width: default, align: left, border: '', foreground: '',
      visible: true, text: 'There isn''t a dedicated print function currently, however
        if you use the Chrome web browser it is possible to save a reasonable-looking
        PDF.


        1. Perform your search as per normal and get the results up on screen.


        2. Right-click and choose ''Print''


        3. Change your printer option to ''Save PDF''


        4. Set a couple of other settings:

        - Set orientation to ''Landscape''

        - Set margins to ''Minimal''

        - Tick the ''Include Background Graphics'' checkbox (to include the colours)

        - Reduce the scale to something like 60-70 (as it will make it fit on a page
        better)', font_size: null, font: '', spacing_above: small, icon_align: left,
      spacing_below: small, italic: false, background: '', bold: false, underline: false,
      icon: ''}
    name: label_5
